                                    <div class="panel-body">
                                        <div class="editor-content">
                                            <p>Becoming a Docker expert takes time and mindful practice. But&nbsp;with persistence,&nbsp;that can be achieved!&nbsp;&nbsp;</p>
                                            <p>The route to becoming an expert starts with a –&nbsp;</p>
                                            <ul>
                                                <li>Strong foundation on the basics&nbsp;&nbsp;</li>
                                                <li>Then, you will need to get training from certified institutes/professionals&nbsp;</li>
                                                <li>Have a good grasp on – Docker Filesystems, Docker, Compose, Machine&nbsp;&nbsp;</li>
                                                <li>Learn all about Orchestration – allows to move from containers to services&nbsp;&nbsp;</li>
                                                <li>Practice and Practice a lot, it just helps you get better at executing Docker&nbsp;&nbsp;</li>
                                                <li>Look for latest developments from the Docker community&nbsp;&nbsp;</li>
                                                <li>If possible, attend some Docker meet-ups&nbsp;&nbsp;</li>
