                <div class="col-md-9">
                    <h2 class="section-heading">Faq</h2>
                    <h3 id="">Faq</h3>
                    <div class="panel-group faq-accordion-1" role="tablist" aria-multiselectable="true">
                        <div class="panel panel-default">
                            <div class="panel-heading active" role="tab" id="faq-heading-1-1">
                                <h4 class="panel-title"> <a role="button" data-toggle="collapse" data-parent=".faq-accordion-1" href="#faq-1-1" aria-expanded="true" aria-controls="faq-1-1">Why is this course relevant?</a> </h4>
                            </div>
                            <div id="faq-1-1" class="panel-collapse collapse in" role="tabpanel" aria-labelledby="faq-heading-1-1">
                                <div class="panel-body">
                                    <div class="editor-content">
                                        <p>Containerization has become the new norm, as it allows applications to be easily moved through the development, testing and production lifecycles without any technical friction.&nbsp; This helps to achieve consistency across multiple, diverse environments and facilitates easy portability and scaling.</p>
                                        <p>With our hands-on training, you can become a part of the new wave of innovation in cloud computing and containerization. In this new <a href="https://info.mirantis.com/Forrester-New-Wave-Enterprise-Container-Platform" target="_blank" rel="nofollow">Forrester Wave report</a>, Docker is said to ‘lead the pack’ when it comes to enterprise container platform suites. KnowledgeHut’s experiential course will help you to kickstart your career in the DevOps space as a Docker expert with the hands-on skills that most employers are seeking.&nbsp;</p>
                                    </div>
                                </div>
                            </div>
                        </div>
