                    <h3 id="">Workshop Experience</h3>
                    <div class="panel-group faq-accordion-2" role="tablist" aria-multiselectable="true">
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="faq-heading-2-1">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-2" href="#faq-2-1" aria-expanded="false" aria-controls="faq-2-1">How is the Docker training conducted?</a> </h4>
                            </div>
                            <div id="faq-2-1" class="panel-collapse collapse" role="tabpanel" aria-labelledby="faq-heading-2-1">
                                <div class="panel-body">
                                    <div class="editor-content">
                                        <p>KnowledgeHut’s&nbsp;Docker training is interactive, immersive, and full of practical learning. The training is conducted in three modes and you can choose any training mode based on your needs. There are three modes of training:&nbsp;one to one training,&nbsp;online classroom training, and Team/Corporate training.&nbsp;</p>
                                        <ul>
                                            <li data-leveltext="" data-font="Symbol" data-listid="17" aria-setsize="-1" data-aria-posinset="1" data-aria-level="1"><strong>One to one training-</strong>&nbsp;</li>
                                        </ul>
                                        <p>One to one training is an effective mode of training that can be individualized and catered to your requirements. If a person is interested in attending a face to face approach, choosing one to one training will be an added advantage. Our trainers at&nbsp;KnowledgeHut&nbsp;are dedicated and help you reach your goals&nbsp;by giving you the best possible&nbsp;resources&nbsp;and training.&nbsp;&nbsp;&nbsp;</p>
                                        <ul>
                                            <li data-leveltext="" data-font="Symbol" data-listid="17" aria-setsize="-1" data-aria-posinset="1" data-aria-level="1"><strong>Online Classroom training-</strong>&nbsp;</li>
                                        </ul>
                                        <p>The online classroom training is the virtual classroom training where you can learn all the latest skills whenever you need. This is the live instructor-led training session that helps professionals to get ahead in their careers.&nbsp;</p>
                                        <ul>
                                            <li data-leveltext="" data-font="Symbol" data-listid="17" aria-setsize="-1" data-aria-posinset="2" data-aria-level="1"><strong>Team/Corporate training-</strong>&nbsp;</li>
                                        </ul>
                                        <p> </p>
                                        <p>In the Team/Corporate training mode, an organization recommends its entire team for online or classroom training and the training is catered as per the team’s requirements. Corporate training consists of videos, certification courses, and other blended learning options that will help your employees to create a competitive edge, produce better results, and reach strategic goals.</p>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="faq-heading-2-2">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-2" href="#faq-2-2" aria-expanded="false" aria-controls="faq-2-2">How long it will take to complete the course?</a> </h4>
