                                        <p>The time taken to complete the course is variable and dependent on the student.&nbsp;</p>
                                        <p> </p>
                                        <p>At&nbsp;KnowledgeHut, the online course is a combination of 24 hours of Live Sessions, 50+ Hours of Quiz and MCQs, 20 Hours of Hands-on sessions and some Live projects.&nbsp;&nbsp;</p>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div class="panel panel-default">
                            <div class="panel-heading" role="tab" id="faq-heading-2-3">
                                <h4 class="panel-title"> <a class="collapsed" role="button" data-toggle="collapse" data-parent=".faq-accordion-2" href="#faq-2-3" aria-expanded="false" aria-controls="faq-2-3">What things do I need to attend the Docker Online classes?</a> </h4>
